import React from 'react'
import materiel from '../../data/materiel'

function Carousel ()  {
  return (
    <div className="w-3 h-90 carousel rounded-box">
        {materiel.map((materiels) => (
            <div className="carousel-item w-full">
                 <img  className="w-full" alt="Tailwind CSS Carousel component"key={materiels.id} src={materiels.photo} />
             </div>      
         ))}

  </div>
  )
}

export default Carousel
